import React, { useState } from 'react'
import './Form.css'

const Form = ({ setStartDate, setEndDate }) => {
  const[inputStartDate, setInputStartDate] = useState('')
  const[inputEndDate, setInputEndDate] = useState('')

  const submitDates = (inputStartDate, inputEndDate) => {
    setStartDate(inputStartDate)
    setEndDate(inputEndDate)
  }

  return (
    <div>
      <h2>form</h2>
      <input className='start-date' type='date'>Start</input>
      <input className='end-date' type='date'></input>
      <button onClick={() => submitDates('1', '2')} > Select Dates </button>
    </div>

  )
}

export default Form
